import "core-js/modules/es6.function.name";
import "core-js/modules/web.dom.iterable";
import { parse } from '@/utils/webpack-key-path';

var ComponentsContext = require.context('@/views/components', true, /\.vue$/);

var ComponentsKeys = ComponentsContext.keys();
var registerComponents = [];
ComponentsKeys.forEach(function (keyPath) {
  var file = ComponentsContext(keyPath);
  var component = file.default || file;
  var parsed = parse(keyPath);

  if (/(#)/.test(parsed.name)) {
    return;
  }

  if (!component.name) {
    console && console.warn("component [".concat(parsed.name, "] should give a name"));
    return;
  }

  registerComponents.push(component);
});
export default registerComponents;
